import React, { useState, useEffect } from 'react';
import api from './services/api'

import './App.scss';

const App = () => {
  const [data, setData] = useState([])
  const [keys, setKeys] = useState([])

  // const getKeys = (obj) => {
  //   Object.keys(obj).map(setKeys)
  // }

  useEffect(() => {
    api.get('/data')
      .then((res) => {
        setData(res.data)
        setKeys(Object.keys(res.data))
      })
      .catch(err => console.log('Error -->', err))
  }, [])

  console.log(keys)

  return (
    <div className="app">
      {
        keys.map((d, i) => <span>Aqui {i}</span>)
      }
      <span>Oi</span>
    </div>
  )
}

export default App;
